import "./ChatBox.css";
import Message from "../Message";
import MyMessage from "../";

class ChatBox extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        isLoading: false,
      };
    }

    render() {
        return (
            <div>
            <h1>Gu is Chatbox</h1>
            <Message />
            </div>
        );
    }

}

export default ChatBox;
